import { Route, Routes } from "react-router-dom"
import "./App.css"
import Schedule from "./components/Schedule.js"

function App() {
  return (
    <div className="App">

      <Routes>
        <Route path="schedule" element={<Schedule />} />
      </Routes>
    </div>
  )
}

export default App
